INSERT INTO `jurnal` (`id_jurnal`, `judul`, `penulis`, `abstrak`, `email`, `tahun`, `issn`, `isbn`, `pdf_jurnal`) VALUES
(3, 'Menanam Padi', 'Rendy Galih S', 'abstrak', 'rendymasamune@gmail.com', 2020, '-', '212', 'menanam_padi.pdf'),
(4, 'Sistem Pakar Diagnosa Mental Ilness Psikosis dengan Menggunakan Metode Certainty Factor', 'Graha Virgian Gustira Putri ', 'Healthy or not a person\'s life is not only based on physical but also mental. Mental and physical health must be balanced to get a good life. Many people do not pay attention to their mental health and the people around them so that their lives can no longer be saved. One result of disturbed mental health is the case of depression, hurting yourself (cutting) to suicide. Mental Illness (mental health disorders) include depression, anxiety, psychosis, phobia, trauma, insomnia, and so on. Psychosis is a meaningful medical term about disturbing mental states caused by delusions or hallucinations. Types of mental illness psychosis are Schizophrenia, Depression, Bipolar, PTSD, and Paranoia. Unfortunately psychiatrists are not as many experts in other health fields as this is proven by the few psychiatric hospitals in each region. To provide knowledge to the public, and minimize late actions, it is necessary to make a tool. One of the implementations applied by expert systems in the field of ', 'gvirgian@gmail.com', 2018, '2527-9866', '-', 'Sistem_Pakar_Diagnosa_Mental_Ilness_Psikosis_dengan_Menggunakan_Metode_Certainty_Factor.pdf'),
(5, 'RANCANG BANGUN  SISTEM PAKAR DIAGNOSA PENYAKIT KULIT BERBASIS MOBILE DENGAN MENGGUNAKAN  METODE BACKWARD CHAINING', 'Ada Udi Firmansyah ', ' Seeing the rapid development of today\'s technology, also developed a system that is able to adopt the technology and the human way of thinking which is an expert system. An expert system is a computer program designed to model the ability to solve problems is what one expert. In this case I am trying to implementan expert system for diagnosing skin disease. The main objective of this the sisis to build a knowledge-based system to diagnose skin disease and solutions behavior what should be done to tackle the disease skin shown in the form of a website using PHP with MySQL database, so we can find out as early as possible if we are suffering from skin disease or not. ', 'audi.ciyanda@gmail.com', 2019, ' 2615  4307 ', '-', 'RANCANG_BANGUN_SISTEM_PAKAR_DIAGNOSA_PENYAKIT_KULIT_BERBASIS_MOBILE_DENGAN_MENGGUNAKAN_METODE_BACKWARD_CHAINING.pdf'),
(6, 'Pengujian Sistem Informasi Akuntansi Biaya Operasional Sekolah Dengan Black Box Testing ', 'Mursyidah, Hari Toha Hidayat', ' Sistem informasi saat ini telah menjadi kebutuhan pada masyarakat untuk membantu dalam menyelesaikan berbagai pekerjaan. Masyarakat telah menyadari akan pentingnya keberadaan sistem informasi dalam membantu memonitoring pekerjaan yang sudah dilakukan maupun sebagai bentuk untuk pengolahan data yang lebih mudah dibandingkan dengan cara manual. Salah satu bentuk implementasi sistem informasi akuntansi adalah pengelolaan dana biaya operasional sekolah. Dimana pada biaya operasional sekolah lebih mengarah pada akuntansi dikarenakan pengolahan didalamnya sesuai dengan keilmuan dibidang akuntansi. Oleh karena itu, supaya penggunaan dana BOS bisa dipertanggungjawabkan maka diperlukan sebuah sistem dalam pengelolaan dan monitoringnya. Pembuatan sistem informasi akuntansi biaya operasional sekolah diperlukan supaya bisa membantu para pengelola dana BOS dalam memonitoring dan mengevaluasi setiap penggunaan dana BOS. Perancangan dalam pembuatan sistem informasi akuntansi biaya operasional sekola', 'mursyidah@pnl.ac.id', 2017, '2548-1180 ', '-', 'Pengujian_Sistem_Informasi_Akuntansi_Biaya_Operasional_Sekolah_Dengan_Black_Box_Testing_.pdf'),
(7, 'PENGUJIAN BLACK BOX TESTING PADA APLIKASI  ACTION & STRATEGY BERBASIS ANDROID  DENGAN TEKNOLOGI PHONEGAP', 'Wahyu Nur Cholifah, Yulianingsih, Sri Melati Sagita ', 'Perkembangan android saat ini sudah menjadi bagian kebutuhan harian bagi masyarakat umum dan pekerja. Dengan demikian dianggap perlu membangun aplikasi action & strategy berbasis Android sebagai media sharing knowledge bagi anggota brimob untuk meningkatkan mutu dan kualitas dari tiap-tiap personil. Dan untuk mendapatkan hasil yang optimal maka dilakukan pengujian secara menyeluruh terhadap interface sistem aplikasi dengan menggunakan black box testing dengan tujuan mengetahui apakah fungsi-fungsi pada aplikasi telah berjalan sesuai dengan fungsinya dan mengevaluasi kesesuaian aplikasi dengan kebutuhan pengguna.Pengujian dilakukan dalam dua tahap, pertama uji fungsi aplikasi android oleh sejumlah pengguna dan dilakukan secara bersamaan.pengujiankeduauji fungsi web admin oleh seorang pengguna dan pada kedua hasil pengujian tidak ditemukan adanya kesalahan pada sistem.Metode kuantitatif digunakan dalam proses penelitian ini untuk digunakan dalam melakukan testing.', 'wnurcholifah@gmail.com', 2018, ' 2549 -2837 ', '-', 'PENGUJIAN_BLACK_BOX_TESTING_PADA_APLIKASI_ACTION_STRATEGY_BERBASIS_ANDROID_DENGAN_TEKNOLOGI_PHONEGAP.pdf'),
(8, 'Pengujian Black Box pada Aplikasi Penjualan Berbasis Web Menggunakan Teknik Boundary Value Analysis ', 'Muhamad Nurudin, Windi Jayanti, Rio Dwi Saputro, Masda Priadyan Saputra, dan Yulianti', 'In a software test, validation is one of the processes of checking whether the software meets the expected specifications and objectives or not. The data validation process has not been maximized can result in a mismatch of data that will be stored in the database. For example the amount of stock turned negative, or the number of digits entered can exceed the defined limits. This can be detrimental to the owner and user in using this application. Therefore, it is necessary to improve the quality of validation more accurately, so it can help the owner in terms of data accuracy. Applications are designed in such a way must go through a testing phase to ensure the quality of the software itself. Examples of tests can be said to be good if they have a chance of finding an error that cannot be revealed. Among the many ways of the Black Box testing methods, this study uses the Boundary Value Analysis testing method. The method tests the maximum number of limits and the minimum number of limi', 'rio06121998@gmail.com', 2019, ' 2541-1004 ', '-', 'Pengujian_Black_Box_pada_Aplikasi_Penjualan_Berbasis_Web_Menggunakan_Teknik_Boundary_Value_Analysis_.pdf');

